import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function Home() {
	return (
		<>
			<div className="bio">
				<p>Hi, thanks for stopping by!</p>
				<p>
				Iâ€™m Matthew, a 3rd year student at McMaster University pursuing a degree in Software Engineering,
				and the Director of Projects at McMaster AI Society.
				<br />
				In my free time I enjoy pushing myself on my roadbike, conquering new slopes on my skis,
				honing my skills in games, and of course, working on side-projects.
				</p>
			</div>
		</>
	);
}

function Experience() {
  return (
    <>
      <header>
        <h3 className="worktitle">Evertz Microsystems</h3>
      </header>
    </>
  );
}

function Projects() {
  return <div>Check out these projects!</div>;
}

function Skills() {
  return <div>Tech Skills go here</div>;
}

export default function App() {
  return (
    <Router>
      <header className="headerbar">
        <h1 className="title">Matthew Nesbitt</h1>
        <nav className="navbar">
          <Link to="/">Home</Link>
          {" "}<Link to="/experience">Experience</Link>
          {" "}<Link to="/projects">Projects</Link>
          {" "}<Link to="/skills">Skills</Link>
        </nav>
      </header>
      <main>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/experience" element={<Experience />} />
          <Route path="/projects" element={<Projects />} />
          <Route path="/skills" element={<Skills />} />
        </Routes>
      </main>
    </Router>
  );
}
